// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AccessRegistry {
    address public admin;
    address public superAdmin;

    event AdminChanged(address indexed oldAdmin, address indexed newAdmin);
    event SuperAdminChanged(address indexed oldSuperAdmin, address indexed newSuperAdmin);

    constructor() {
        superAdmin = msg.sender;
        admin = msg.sender;
    }

    modifier onlySuperAdmin() {
        require(msg.sender == superAdmin, "Not super admin");
        _;
    }

    function changeAdmin(address newAdmin) public onlySuperAdmin {
        require(newAdmin != address(0), "New admin cannot be zero address");
        address oldAdmin = admin;
        admin = newAdmin;
        emit AdminChanged(oldAdmin, newAdmin);
    }

    function changeSuperAdmin(address newSuperAdmin) external onlySuperAdmin {
        require(newSuperAdmin != address(0), "New super admin cannot be zero address");
        address oldSuperAdmin = superAdmin;
        superAdmin = newSuperAdmin;
        emit SuperAdminChanged(oldSuperAdmin, newSuperAdmin);
    }

    function getAdmin() external view returns (address) {
        return admin;
    }

    function getSuperAdmin() external view returns (address) {
        return superAdmin;
    }

    function renounceAdminRole() external onlySuperAdmin {
        changeAdmin(address(0));
    }

    function transferAdminRole(address newAdmin) external onlySuperAdmin {
        changeAdmin(newAdmin);
    }

    function addAdmin(address _admin) external onlySuperAdmin {
        changeAdmin(_admin);
    }

    function removeAdmin() external onlySuperAdmin {
        changeAdmin(address(0));
    }
}

