// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./AccessRegistry.sol";
import "./LibStorage.sol";

contract DiamondProxy {
    event DiamondCut(address indexed facetAddress, bytes4[] functionSelectors);

    constructor(address _accessRegistryAddress) {
        LibStorage.DiamondStorage storage ds = LibStorage.diamondStorage();
        ds.accessRegistryAddress = _accessRegistryAddress;
    }

    modifier onlyAdmin() {
        AccessRegistry accessRegistry = AccessRegistry(LibStorage.diamondStorage().accessRegistryAddress);
        require(msg.sender == accessRegistry.getAdmin(), "Not admin");
        _;
    }

    function getAdmin() external view returns (address) {
        AccessRegistry accessRegistry = AccessRegistry(LibStorage.diamondStorage().accessRegistryAddress);
        return accessRegistry.getAdmin();
    }

    function addFacet(address _facetAddress, bytes4[] memory _functionSelectors) external onlyAdmin {
        LibStorage.DiamondStorage storage ds = LibStorage.diamondStorage();
        require(!ds.facetAddresses[_facetAddress], "Facet already exists");

        for (uint256 i = 0; i < _functionSelectors.length; i++) {
            ds.functionToFacet[_functionSelectors[i]] = _facetAddress;
        }

        ds.facetAddresses[_facetAddress] = true;
        emit DiamondCut(_facetAddress, _functionSelectors);
    }

    function getFacetAddress(bytes4 _functionSelector) external view returns (address) {
        return LibStorage.diamondStorage().functionToFacet[_functionSelector];
    }

    fallback() external payable {
        LibStorage.DiamondStorage storage ds = LibStorage.diamondStorage();
        address facet = ds.functionToFacet[msg.sig];
        require(facet != address(0), "Function does not exist");

        assembly {
            calldatacopy(0, 0, calldatasize())
            let result := delegatecall(gas(), facet, 0, calldatasize(), 0, 0)
            returndatacopy(0, 0, returndatasize())
            switch result
            case 0 {revert(0, returndatasize())}
            default {return (0, returndatasize())}
        }
    }

    receive() external payable {}
}

