// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./LibStorage.sol";
import "./AccessRegistry.sol";

contract FacetA is ReentrancyGuard {
    event ValueChanged(uint256 oldValue, uint256 newValue);

    struct FacetAStorage {
        uint256 value;
    }

    bytes32 constant FACET_A_STORAGE_POSITION = keccak256("diamond.standard.faceta.storage");

    function facetAStorage() internal pure returns (FacetAStorage storage fs) {
        bytes32 position = FACET_A_STORAGE_POSITION;
        assembly {
            fs.slot := position
        }
    }

    modifier onlyAdmin() {
        AccessRegistry accessRegistry = AccessRegistry(LibStorage.diamondStorage().accessRegistryAddress);
        require(msg.sender == accessRegistry.getAdmin(), "Not admin");
        _;
    }

    function setValue(uint256 _value) external onlyAdmin nonReentrant {
        FacetAStorage storage fs = facetAStorage();
        uint256 oldValue = fs.value;
        fs.value += _value;
        emit ValueChanged(oldValue, fs.value);
    }

    function getValue() external view returns (uint256) {
        return facetAStorage().value;
    }
}

